import React from 'react';

const Toolbar: React.FC = () => {
    return (
        <div style={{ 
            height: 50, 
            border: '1px solid #ccc', 
            padding: '8px 16px', 
            background: '#f0f0f0',
            display: 'flex',
            alignItems: 'center',
            gap: 16
        }}>
            <h2 style={{ margin: 0, fontSize: 18 }}>Neural Network Builder</h2>
            <button style={{ padding: '4px 12px' }}>Save</button>
            <button style={{ padding: '4px 12px' }}>Load</button>
            <button style={{ padding: '4px 12px' }}>Clear</button>
        </div>
    );
};

export default Toolbar;
